export default class Card{constructor(i,t,a,s){this.abstract=i,this.url=t,this.img=a,this.id=s}create(i){i.append('<li class="card" id="'+this.id+'"><a href="'+this.url+'" target="_blank"></a><figcaption>'+this.abstract+"</figcaption></li>"),$("#"+this.id).css({"background-image":"url("+this.img+")"})}}